// Compare Git workflow names against existing n8n workflows
const items = $input.all();

let allWorkflows = [];

try {
  const checkNode = $('Get All Existing Workflows').first();

  if (checkNode?.json?.data && Array.isArray(checkNode.json.data)) {
    allWorkflows = checkNode.json.data;
  } else if (Array.isArray(checkNode?.json)) {
    allWorkflows = checkNode.json;
  } else if (checkNode?.json?.workflows && Array.isArray(checkNode.json.workflows)) {
    allWorkflows = checkNode.json.workflows;
  } else {
    const allItems = $('Get All Existing Workflows').all();
    if (allItems.length > 0 && allItems[0].json?.data) {
      allWorkflows = allItems[0].json.data;
    }
  }
} catch (error) {
  console.error('Error getting workflows:', error);
}

console.log(`Found ${allWorkflows.length} existing workflows in n8n`);

return items.map(item => {
  const workflowData = item.json;
  const gitName = (workflowData?.name || '').trim();

  if (!gitName) {
    return { 
      json: { 
        error: "No workflow name", 
        exists: false,
        workflowData: workflowData 
      } 
    };
  }

  const match = allWorkflows.find(wf => 
    (wf.name || '').trim().toLowerCase() === gitName.toLowerCase()
  );

  return {
    json: {
      workflowName: gitName,
      exists: !!match,
      workflowId: match?.id || null,
      workflowData: workflowData
    }
  };
});

