// Runs ONCE. Pulls:
//   - all n8n workflows from 'Get All n8n Workflows'
//   - the fileMap from 'Build GitHub File Map' (this node's input)
// Filters out inactive + excluded workflows, then annotates
// each with its GitHub match. Outputs one item per workflow.
// ─────────────────────────────────────────────────────────────

const excludeList = [
  'git_push_sync',
  'monitoring_workflow',
];

// fileMap comes in as this node's single input item
const fileMap = $('Build GitHub File Map5').json.fileMap || {};

// All n8n workflows from the earlier node
const allWorkflows = $('Split Out1').all();

const output = [];
for (const item of allWorkflows) {
  const wf = item.json;

  // Apply filters
  if (!wf.active) continue;
  if (excludeList.includes(wf.name)) continue;

  // Annotate with GitHub match info
  const match = fileMap[wf.name] || null;
  output.push({
    json: {
      ...wf,
      existsInGitHub: !!match,
      githubDownloadUrl: match ? match.download_url : null,
      githubSha: match ? match.sha : null
    }
  });
}

return output;

// FIX: GitHub blob API returns base64-encoded content — decode it to get the workflow JSON
// Previously there was no decode step; the raw base64 was passed downstream which caused failures

const items = $input.all();

return items.map((item, i) => {
  // The HTTP node returns the blob response directly
  const blobResponse = item.json;

  // Grab passthrough fields from the previous node (Filter & Tag)
  const prev = $('Filter & Tag Workflows').all()[i]?.json || {};

  let workflowData = null;
  let decodeError = null;

  try {
    if (blobResponse.encoding === 'base64' && blobResponse.content) {
      // Remove newlines GitHub inserts into the base64 string
      const clean = blobResponse.content.replace(/\n/g, '');
      const decoded = Buffer.from(clean, 'base64').toString('utf-8');
      workflowData = JSON.parse(decoded);
    } else {
      decodeError = 'Unexpected response format: ' + JSON.stringify(Object.keys(blobResponse));
    }
  } catch (e) {
    decodeError = e.message;
  }

  return {
    json: {
      workflowName: prev.workflowName,
      exists: prev.exists,
      workflowId: prev.workflowId,
      githubSha: prev.githubSha,
      workflowData: workflowData,
      decodeError: decodeError
    }
  };
});

// Build a map of { filename -> { sha, url, size } } from the GitHub tree
const items = $input.all();
const fileMap = {};

for (const item of items) {
  const tree = item.json.tree;
  if (Array.isArray(tree)) {
    for (const f of tree) {
      if (f.type === 'blob') {
        fileMap[f.path] = {
          sha: f.sha,
          url: f.url,   // GitHub blob API URL
          size: f.size
        };
      }
    }
  }
}

return [{ json: { fileMap } }];

// FIX: Iterate GitHub files (fileMap) and check if each exists in n8n
// Previously this was inverted — it iterated n8n workflows and checked GitHub

const excludeList = [
  'git_push_sync',
  'monitoring_workflow'
];

const fileMap = $('Build GitHub File Map').first().json.fileMap || {};

// Get all existing n8n workflows
let allWorkflows = [];
try {
  const checkNode = $('Get All Existing Workflows1').first();
  if (checkNode?.json?.data && Array.isArray(checkNode.json.data)) {
    allWorkflows = checkNode.json.data;
  } else if (Array.isArray(checkNode?.json)) {
    allWorkflows = checkNode.json;
  }
} catch (e) {
  console.error('Error fetching existing workflows:', e);
}

const output = [];

for (const [filename, meta] of Object.entries(fileMap)) {
  // Skip excluded files
  if (excludeList.includes(filename)) continue;

  // Check if this GitHub file already exists as an n8n workflow (match by name)
  const match = allWorkflows.find(
    wf => (wf.name || '').trim().toLowerCase() === filename.trim().toLowerCase()
  );

  output.push({
    json: {
      workflowName: filename,
      githubBlobUrl: meta.url,   // FIX: was match.download_url (didn't exist); now using meta.url
      githubSha: meta.sha,
      exists: !!match,
      workflowId: match?.id || null
    }
  });
}

console.log(`GitHub files to sync: ${output.length}`);
return output;

// FIX: _action is now properly set by Tag as Updated / Tag as Created Set nodes
